import React from "react";
import icon from "../../../assets/icon.svg";
import {
  faConciergeBell,
  faStar,
  faEnvelope
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Head extends React.Component {
  render() {
    return (
      <div className="menu-head">
        <img src={icon} alt="restaurant logo" height="50" width="50" />
        <div className="menu-head-content">
          <h1>AJEGUNLE FINEST CHAO!</h1>
          <p>
            {" "}
            <FontAwesomeIcon color="#d6db46" icon={faConciergeBell} /> All Local
            and International Dishes
          </p>
          <FontAwesomeIcon color="#d6db46" icon={faStar} />
          <p>Delivery fee: #400</p>
          <p>Min Order: #500 Max Order: #700</p>
        </div>

        <div className="menu-links">
          <a href="#">
    
            <FontAwesomeIcon icon={faEnvelope} /> Message Restaurant
          </a>
          <a href="#">Visit site</a>
        </div>
      </div>
    );
  }
}

export default Head;
